package basic_003;
//write a java code to print even from 85 to 95
public class A008_forloop_even_85_95 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 85; i <=95; i++) {
			if (i%2==0) {
				System.out.println(i);
				
			}
		}

	}

}
